import React from 'react'
import { Grid } from '@mui/material'

export default function About() {
  return (
    <div>
        <Grid container
        sx={{
            border: "3em solid pink",
            padding:"2em 7em 20em"
        }}>
            <Grid item
            sx={{
                border:"1px solid orange",
                display: "flex",
                justifyContent: "center"
            }}>
                <h1>Hey Bitch</h1>
            </Grid>
        </Grid>
    </div>
  )
}
